import React from 'react';
import { Cards, Charts, CountryPicker } from './Components';
import styles from './App.module.css';
import {fetchData} from './api';


class App extends React.Component {
	render()  {
		return(
			<div className={styles.container}>
			<Cards />
			<CountryPicker />
			<Charts /> 
			</div>
		)
	}
}
export default App;
